import React, { useState } from "react";
import Card from "./Card";
// import data from "../data.json";
import Data from "./Data";

function NewCard() {

    const [active, setActive] = useState("SecondCard");

    return(

        <div className="new-app">

            <nav>
                <button onClick={() => setActive("FirstCard")}>One</button>
                <button onClick={() => setActive("SecondCard")}>Two</button>
                <button onClick={() => setActive("ThirdCard")}>Three</button>
            </nav>

            <div>
                {active === "FirstCard" && <Card data={Data} title="1" />}
                {active === "SecondCard" && <Card data={Data} title="2" />}
                {active === "ThirdCard" && <Card data={Data} title="3" />}
            </div>
        </div>
    );
}

export default NewCard;
